};
uniform sampler2D _waveTexture;
layout(std140) uniform Constant {
  vec4 _waveBaseColor;
  vec2 _offset;
  vec2 u_resolution;
  float _tilling;
  float _speed;
};
in vec4 color;
#if USE_TEXTURE
  in vec2 uv0;
  uniform sampler2D cc_spriteTexture;
#endif
vec4 waveColor () {
  vec2 uv;
  float size;
  if(u_resolution.x > u_resolution.y)
    size = u_resolution.y;
  else
    size = u_resolution.x;
  uv = vec2(gl_FragCoord.xy / size);
  vec2 offset = _offset * _speed * cc_time.x;
  vec4 wColor = texture(_waveTexture , uv * _tilling + offset);
  wColor = wColor * _waveBaseColor;
  return wColor;
}
vec4 frag () {
  vec4 o = vec4(1, 1, 1, 1);
  #if USE_TEXTURE
    o *= CCSampleWithAlphaSeparated(cc_spriteTexture, uv0);
    float r = color.x-(color.y+color.z)*0.5;
    if(r>=0.0)
      o = o*(1.0+r)+vec4(r,0.0,0.0,0.0);
    #if IS_GRAY
      float gray  = 0.2126 * o.r + 0.7152 * o.g + 0.0722 * o.b;
      o.r = o.g = o.b = gray;
    #endif
  #endif
  o *= color;
  #if USE_TEXTURE
    if(color.xyz != vec3(0.0,0.0,0.0)){
      vec4 wColor = waveColor();
      o.rgb += wColor.rgb;
    }
  #endif
  ALPHA_TEST(o);
  return o;
}
layout(location = 0) out vec4 cc_FragColor;
void main() { cc_FragColor = frag(); }

