vec4 CCFragOutput (vec4 color) {
  return color;
}
#if CC_USE_FOG != 4
#endif
#if !CC_USE_ACCURATE_FOG
varying mediump float v_fog_factor;
#endif
varying vec2 v_uv;
varying vec2 v_uv1;
varying vec3 v_position;
uniform sampler2D mainTexture;
uniform sampler2D _waveTexture;
   uniform vec4 mainColor;
   uniform vec4 colorScaleAndCutoff;
   uniform vec4 _waveBaseColor;
   uniform float _tilling;
   uniform float _speed;
   uniform vec2 _offset;
#if USE_ALPHA_TEST
#endif
vec4 waveColor (vec2 uv) {
  vec2 offset = _offset* _speed * cc_time.x;
  vec4 wColor = texture2D(_waveTexture, uv * _tilling+offset);
  wColor = wColor * _waveBaseColor;
  float stren = 1.0;
  return wColor * stren;
}
vec4 frag () {
  vec4 o = mainColor * texture2D(mainTexture, v_uv);
  o.rgb *= colorScaleAndCutoff.xyz;
  #if USE_ALPHA_TEST
    if (o.ALPHA_TEST_CHANNEL < colorScaleAndCutoff.w) discard;
  #endif
  #if USE_TILLING_OFFSET
    vec4 wColor = waveColor(v_uv1);
    o = o + wColor;
  #endif
  return CCFragOutput(o);
}
void main() { gl_FragColor = frag(); }
